import { 
    ContainerServices,
    Items
} from "./styled";


const services = [
    {
        projeto: "Radio Agioa FM",
        lingagens: "PHP, js, HTML5, bootstrap, css3",
        img: "teste",
        site: "www.radioaguiafm.com.br"  
    },
    {
        projeto: "Radio Agioa FM",
        lingagens: "PHP, js, HTML5, bootstrap, css3",
        img: "teste",
        site: "www.radioaguiafm.com.br"  
    },
    {
        projeto: "Radio Agioa FM",
        lingagens: "PHP, js, HTML5, bootstrap, css3",
        img: "teste",
        site: "www.radioaguiafm.com.br"  
    }
]

export function Services(){
    return(
        <ContainerServices>
            {
                services.map((item, index) => {
                    <Items>
                        {item.projeto}
                    </Items>
                })
            }

        </ContainerServices>
    )
}
